准确性波动较大]', '[继续保持, 还是要多看错题，多重复知识点，会有很大的帮助的, 超前学习，个人认为用处不大，还是要搞懂学过的知识, 可多督促孩子看看错题，在写完作业之后，花十几二十分钟时间来看看错题，哪怕不写，看一遍 加深印象, 可以对对学习某些特定题目的解题技巧，这样写题的速度和准确性就会大大提高, 还是要稳中求胜，容易粗心，简单的只是一不小心就会出错。看题的时候要慢慢看，不要串行，导致题目出错。]'), ('96417002-12ad-42dd-9bc3-2de1dd93c5f8', '[可能是因为太累了，加上睡眠不足，专注力不是很好。, 对第一章内容掌握的不错，第二章较之以前也已经有了不小的进步。, 因讲述的是上学期内容，学生又在学习新知识，所以学生没有时间去预习和复习上学期内容, 因讲述的是上学期内容，学生又在学习新知识，所以学生没有时间去预习和复习上学期内容, 考试技巧掌握的不错。, 做题速度属于平均，不快不慢，准确率也还行。]', '[多多休息，按时睡觉，也可以多参加一些体育活动，劳逸结合。, 加强对第二章内容的复习巩固，对多种做题方法的运用。, 会在以后的课堂中穿插一些复习过的知识, 会在以后的课堂中穿插一些复习过的知识, 会在以后的习题中讲述考试技巧，在考试中如何更简单的拿到分数。, 在复习完相关知识点后，进行做题方法的总结，在保证准确率的前提下，有效的提升做题速度。]'), ('9028c9ed-55f5-4f01-aab8-9925da5320bc', '[听课较专注，但不能认真对待辅导结束前的几分钟，比较急于下课。, 数学必修一二知识点已初步掌握，但不能灵活运用，欠缺习题训练。, 学生较缺乏超前学习意识，不能很好地做到主动预习。, 学生能够主动复习已讲过的知识点, 已掌握一些做题技巧，但不够灵活和全面。, 做题速度中等，准确率很高]', '[学生应注意午休，以防下午学习时困乏；要调整心态，积极面对学习；要珍惜整个辅导时间。老师会尽量将重要知识放在前段时间讲。, 建议学生有时间多做相关习题，不会的或者有疑惑的题目可以做标记积累下来，以便辅导时解决。老师会注意讲做题思路和方法，以引导学生学会知识点的运用。, 学生如果平时功课不多，可以主动提前预习。, 希望学生注意每单元后面的知识结构图，在复习时试着绘制知识结构图。, 老师会提前准备典型例题及对应的做题技巧；辅导过程中也会通过做题分析题目来教授做题技巧。, 学生做题速度不高是因为做题技巧及习惯不到位，建议学生做题时多动笔，试着展开方程或画出图像，当它们一目了然呈现出来的时候，可能就会有思路了。]'), ('cb738951-e544-4c54-bee9-903f17f835b0', '[听课状态良好, 良好, , , 良好, 速度还算快，但是计算还需仔细]', '[, 上次课主要讲的是应用题，应用题的方法就是审题，第一次读题时把关键语句做记号并注意隐含条件，这样可以准确快速的列方程，最后就是要仔细计算了。, , , 建议计算时还是要更仔细，打草稿的时候把字写清楚可能会有帮助，更重要的是写题时的书写，最好能写工整清楚，给改卷老师留个好印象, ]'), ('b7e77aad-fd87-434e-bab0-efb3fc9b56d1', '[上课一直非常认真努力，态度端正，但畏难情绪较为严重，遇到思维量或计算量较大的题就不敢下笔，大题拿到的分就少了。, 基础概念问题较为模糊，物理学习通过结合课本掌握知识点和考点，扫除了知识盲区。, , , 通过经典题型的练习（例如二次函数系数abc的不等关系等题型），学生已基本掌握了所教授的提醒。, 准确率有所提升，但运算速度较慢，耽搁了考试时间。]', '[通过基础题型的练习提升学生信心，帮助学生树立起难题多拿分的观念。同时希望家长能多鼓励孩子。, 多结合课本，不能仅凭刷题得到考点，这样的知识结构是零散的。, 小声很聪明，在老师的思路下能顺利完成题目，但还缺乏学科题感，不能很快找到题目的突破口。在之后的学习中要学会回头看题目，对于题目的提问方式和出题者的意图进行思考。, 保留好近期考试的测验试卷，以便于分析问题，查漏补缺，时常复习。, 继续保持，在作业、测验中运用，牢固记忆。, 有的题将步骤仔细写下来可以提升正确率，但简单的四则运算等应当多口算，每一步都写在草稿纸上很浪费时间。]'), ('e4207004-b076-4e52-9047-65fc0e553e1e', '[上课很专注, 单词，固定搭配较为薄弱, 良好, 良好, 良好, 良好]', '[继续保持, 多背单词和词组, 保持, 复习上面继续加强, 有待提升, 有待提升]'), ('4c939366-dde1-4363-91a7-21bc1501cf05', '[很认