, 在辅导过程中一次模拟测试成绩为91.5]', '[希望在听课的时候能够学会认真记笔记, 希望在继续扩大词汇量，加强落实, 希望继续保持学习劲头, 希望学生注意落实与整理, 希望对于基础题加强联系，争取做到每天都能完成一到基础题, 希望作文方面的字迹一定要工整]');
INSERT INTO suggestions VALUES ('604fe578-0c4f-459a-a5c6-44549a4f0d92', '[相比之前更加积极，更加专注，但仍需坚持, 鉴于之前基础非常薄弱，现在已经掌握了很多基础知识，对课本更加熟悉, 学生几乎不会预习将学知识，不够积极, 在提醒之下学生会稍微复习，但是花的时间还是很少, 学生已掌握初步解题技巧，有一定的思维, 放慢了做题速度，有了更多得到思考，准确率有了提升]', '[加强管理，让学生逐渐脱离手机, 循序渐进，需要帮学生牢牢地打好基础，灵活运用知识, 强调预习重要性，并在课后提醒学生主动预习, 需要共同监督，时刻提醒学生复习重要性，课前会抽查学生所学内容, 需要打牢基础，在此之上再灌输解题技巧，帮助学生学会系统地用方法解题, 首先要保证正确率，不强调速度，但是要仔细，确保拿到分数]'), ('5375d8bc-7691-4e61-8f78-aabd772a38b0', '[较为认真, 掌握情况一般, 自己要学会总结书本知识, 平时多做基础题, 一般, 一般]', '[应该集中精力，把状态调好, 自己多练习, 可以适当完成老师布置的任务, 假期可以复习前面已经学过的知识, 考试中要总结做题的经验, 做题时要有详细的解题过程]'), ('aeff2060-f179-40d3-ba5e-f858c1d8cc46', '[, , asdfa, , , ]', '[, , , , wefa, ]'), ('e55873ed-aa42-4d03-94f9-fc0a1537c3ff', '[有一定进步, 尚需提高, 有一定进步, 尚需提高, 尚需提高, 尚需提高]', '[引导孩子在学习的时候能够放下手机，全身心投入进去---“学的用心，玩的开心”, 通过物理课本帮助孩子深化物理知识理解，构建一个更牢靠的知识网络, 每次授课前还要微信提醒孩子明天上课内容，提醒孩子稍微预习一下, 后期准备每次上课预留10分钟左右时间，教孩子总结归纳每次上课的主要内容, 对孩子每周错题坚持讲解，将课本知识与日常练习题联系起来, 帮助孩子克服“轻题”的习惯]'), ('fd3d86b2-959e-48ca-91a6-28e585bc2b17', '[还是和上学期一样，后面快结束的时候好像没有那么专注, 只上了不到一个单元，学生可能课堂学习效率不是很高, 小豪好像没有这个习惯, 小豪好像大多时候都是被作业牵着走，我也不知道这是初中生的学习习惯还是他自己的。, 这个小豪好像还没有意识，可能是刚上初中，还不想我们这么老油条, 读题慢，而且粗心。经常出现我讲的时候说懂了，还嫌我啰嗦，但是做题的时候就不确定知识点]', '[休息好一点, 家长们可以引导一下学生在课堂上认真一点，这样知识吸收的好一点, 可以看看他喜不喜欢预习，不喜欢的话就算了，他作业也挺多的好像, 有时候我会安排一些课后题给他做，他好像没有那么多时间完成，不知道是不是学习压力也不轻, 前两次带着他做题，提点他几次，他也能知道。接下来我会多带他做题，然后告诉他更多的技巧, 这个只能慢慢来了。要先把知识点吃透。希望他多一点耐心，不要嫌我啰嗦。]'), ('05fdafbf-8e31-44b4-9fc5-b8de289f8b46', '[比较专注，但是在最后的二十分钟内往往会不够专注, 一次函数这一块掌握的不是很好, 没有主动预习的习惯。, 复习的这一块做的不是很好，不少之前学过的知识点都忘记了。, 考试的时候没有做到先易后难，容易被难题卡住。, 速度不够快，准确率也不是很高，需要再接再厉。]', '[希望能打气十二分精神来专注的听讲。, 要加强一次函数，以及基本计算的练习。, 要学会主动的预习。, 要做到及时复习，即使是学过的知识点也不能忘记。, 我会多传授一些解题技巧，希望能做好试卷。, 多做题，加快速度，并且熟练掌握知识点。]'), ('b76c804a-d0f0-478d-87dd-27c4e2d831d3', '[这点表现较好，听课很仔细, 对于数学方面基础较差，主要体现在二次函数方面和一些计算方面要注意的点，例如去括号，移位变正负，乘除换算方面都待加强。, 有待加强。, 由于基础较弱，所以以后锻炼加强这方面的能力。, 有待加强。, 准确率较低，需要注意运算中的一些细节。]', '[继续保持。, 能够跟着我的步伐走，按时完成老师布置的任务。, , , 卷面工整方面要改善。, 特别注意正负号和去括号。]'), ('776c734a-bce0-48d6-96e5-8184061971a0', '[较认真, 一般, 一般, 较好, 较好, 一般]', '[听课时可以培养一下总结题型能力, 接触新知识做题时可以适当地把知识点往题目所求方向靠, 预习时掌握大概方向即可 重点放在课后巩固, 多做题 善于总结 可以有一个错题本, 主要熟悉知识点 多见题型, 这个一定要提高做题速度和读题准确度]'), ('d668d2b7-1808-419d-868e-9a76e91ddb6b', '[, , , kl, , ]', '[, , , , l;, ]'), ('fa4a9cad-7de1-49da-9fae-526fab064a66', '[有进步，但仍需努力, 基本掌握，但遗忘快，要及时复习巩固, 无, 无, 基本掌握，讲解都懂，自主解题能力要继续锻炼, 中]', '[建议:保证休息，提高学习兴趣 \n规划:上课收手机，趣味讲解，亦师亦友，提高学生上课专注的, 建议:课后多复习，回顾讲过的题型的做题步骤，多看多用\n规划:课前带领学生复习，课后再次复习，利用课上时间多带学生复习巩固。不上课时间对学生多督促。重点传授做题方法，使学生成绩有可见提升, 建议:在学校跟上老师的节奏，辅导前学生基本掌握知识点, 规划:课上多巩固，课后多督促, 建议:上课认真听讲，方法会用，多用多练\n规划:讲解搭配学生自主做题思考，多培养学生自主做题能力, 建议:掌握方法，多用多练，提高准确率\n规划:带学生培养做题方法步骤意识，规范做题步骤。并培养日常进行反思总结的习惯，提高准确率]'), ('b091936b-3866-4e98-8ac6-9d72df59a56f', '[学生本阶段的学习没有上阶段的积极性高，对学习方面也有些松懈，而且上厕所的时间也有点长。但听课时也有用心，只是坚持全神贯注地听课的持续时间太短，容易分心，需要加以引导把心思放到学习上来。, 这四次课分别教授的内容是:巩固分式的运算、因式分解；学习的新内容为四边形及平行四边形的证明、正比例函数和一次函数。学生基本掌握，但对知识点的熟练程度不够，需要学生课下自己多做题，加深理解。, 现阶段的学习为复习前面内容，扎实基础。, 学生有一定惰性，未能达到良好的巩固效果。, 学生接受新知识的能力不是很强，所以每个知识点都需要反复强调，考点需要做题时融会贯通。, 学生的做题速度慢，准确率不高，但题目做对时还是可以感受到学生的成就感。]', '[建议家长在上课时间段暂时保管学生手机，否则学生将以上厕所为由在卫生间玩手机，这将浪费大量时间，导致实际上课时间缩短，降低课堂效率，学生也无法集中精力上课。与此同时，我将降低采取鼓励学习方法，对学生的上课表现多一点肯定与表扬，树立学生的自信心，调动学生的积极性。同时也将严格要求学生，上课时间不能去卫生间，休息时间控制在十分钟以内。, 由于学生上学期的补课是从初一的内容开始补起，所以我未能把握好旧知识与新知识间的平衡点，导致学生的成绩未能提高，所以我现阶段的安排是在补习落下的学习内容的同时紧跟学校的知识点学习，争取学生能掌握周内学校学习的新知识。, 如果后期课堂效率高的话，会考虑超前学习，但本阶段只能先补习好初一的基础内容，尽力做到与学校学习同步。, 下阶段将布置周内作业，根据学生现有的辅导书和课堂所学内容，布置相关知识的题目。, 对于公式的背记和理解部分需要加强训练, 以后会将题目的难度等级提前预估，让学生先做较为简单的题目，增强学生的成就感，再慢慢加大题目难度。]'), ('de89ed26-b005-42e6-870a-e367aac4f28c', '[, , , , , ]', '[, , 加强记忆单词语法知识, 做过的试题中涉及的知识点、单词短语, , 把握技巧，加快做题速度]'), ('858ca17d-2205-4934-96df-f339b1826c95', '[对学生有所了解，有所改善, 有所进步, /, 表现还可以，课堂知识可以做到及时回顾, /, 有所进步，准确率提高明显]', '[进一步摸索出让学生专注的方法 共同学习, 多用时间认真背诵, /, 进一步努力, /, 多练习，减少非智力因素失分]'), ('164b3a53-487f-4d0b-8f55-e911ff2ebd7a', '[, , sfa, , , ]', '[, , , weawe, , ]'), ('b6834d89-855e-43b9-bebd-03f7ed7df8d1', '[专注度整体可以，不过偶尔会开小差, 以前学的单词遗忘较多，语法一知半解, 无, 尚未了解, 尚未了解, 准确率不够高]', '[专心上课，该休息就好好休息, 重点讲解语法知识点, 学有余力再进行预习, 回顾之前学过的书本, 指导学生掌握适合自己的方法技巧, 多练习]'), ('6a9ce13b-43bc-4087-8559-17d2067c8377', '[较为认真，专注, 对万有引力知识点掌握有一定加强，能量守恒知识点理解有待加强提