 '[专注度基本不变，偶尔会出现开小差，不过整体还是可以学到知识点, 语法逐渐巩固，由于勤于背诵词汇量稳固提升, 比较少主动预习, 会主动复习学过的知识, , 七选五相对准确率较低]', '[, 单词要做到日复一日的坚持, , 再接再厉, , 各类题目在日常学习都要涉及，加强薄弱项练习]'), ('81965c44-34f3-4eb7-b86c-dc868de6019d', '[上课专注度比刚开始上课时进步很大。, 基础知识掌握有进步，对知识点把握也更准确了。, 主动预习意识还是有一些欠缺。, 基本能做到主动认真复习。, 考试技巧仍需加强。, 做题速度很好，准确率不是很稳定。]', '[自己主动学习，找到不会的知识点并在上课时提出来进行加强。, 最后冲刺阶段应该回归基础，保证状态。, 上课前一定要先找好自己觉得有问题的知识点，以便于上课时及时补充。, 上课后应主动复习和巩固。, 会在后续课程中逐步进行考试技巧的加强。, 做题速度继续保持，但应该稳定准确率。]'), ('49d2f330-bc86-41e0-8c7d-300277fe4aaf', '[较上一阶段有所进步。, 基础知识比如基本字词等掌握还有些欠缺。, , , , ]', '[应通过加强学习兴趣提高专注度。, 平时注意积累，扩展知识面。, , , , ]'), ('c14b02d3-65aa-4a96-8ba4-700a87a1892e', '[良好, 良好, 良好, 良好, 良好, 良好]', '[晚上早点睡，第二天上课精神才会好, , 在学校上课后要认真听课, 在学习需要多做题，整理笔记, , ]'), ('e746feda-1f01-413a-949b-ad4cbcf930e2', '[一般前半段听课会较后半段专注，有的时候会比较不耐烦，但总的来说还是可以的。, 八年级下册数据统计这一块掌握的不是很好，平均数、中位数这些基本概念混淆，另外，配方法解方程的步骤还不是很清晰。, 在我看来，超前学习这一块做的不是特别好，但是偶尔会超前完成部分没有学过的知识的作业。, 不太喜欢复习，以至于有些小学就学过的知识点都忘记了。, 没有什么技巧而言，觉得能够做出来就行了，不是很在乎是否花费了很长的时间。, 速度在可以接受的范围内，但是准确率还有待提高。]', '[希望能够尽量集中精力来听讲，少讲一些无关的话题。, 最主要是要把概念记清楚，所以我希望他能多练习，加深印象。, 不需要太超前多少，但上课前可以稍微提前预习一下，这样有助于理解新知识。, 真的要多去巩固复习，不能因为学过了就算了，还是要时常翻一翻自己做过的习题。, 要有一个虚心学习的态度，不能只追求做出来就行了，要用最短的时间做出来才达到目的了。, 要细心，要有耐心，要看完题目再开始答题。]'), ('be20e8d1-4717-4ff9-b339-776c28a60dbf', '[很认真, 基础较好，缺乏不同知识点的联系运用, 目前不做要求, 希望可以注重一下, 一般, 速度较慢，有待提高]', '[继续保持, 多见一见不同类型的题, 下一次会把题目提前给你, 不会的题可以发给我, 学会取巧, 更熟悉知识点，学会分析题目]'), ('e1177e52-2982-4dd6-acc2-afab0912bc12', '[由于她自身的课程也比较重，所以上课的时候会有些疲惫，上课的专注度会有所下降。, 解方程基本的知识都知道，但是很重要的一个问题就是，很容易忘记了，或者混淆了那些公式。, 没有超前学习的习惯。, 主动复习的能力有所欠缺，往往是别人强制要求才会求复习。, 没有掌握什么应试的技巧，被难题卡住了就会显得很慌乱。, 速度还有待提升，准确度也不够高，主要这个计算有很大的问题。]', '[我会尽量讲的有意思也些，也希望她能分配好自己的精力，留一些到晚上。, 多做练习，然后每天都能抽一点时间练习不熟练的地方，并且，公式要花时间来背诵。, 尽量在上课前稍微预习一下，便于理解。, 多看看以往做过的题目，多去复习。, 多积累一些简便方法，要学会先易后难。, 要细心，并且多计算提高计算能力。]'), ('d5aba5bf-dbee-4c44-bc19-856c8fb4a028', '[进步，上课状态一直很不错, 进步, 进步, 进步, 进步, 持中]', '[, 多背诵单词；知记搭配的词组；注意比较记忆发音相似、拼写相似的单词，不要混淆。, , 希望课后作业能更加认真对待, 这方面在4月的辅导中没有系统的讲授，但已经规范了做题格式，相信会有提升, 单就我布置的作业来看，准确率不高，做题速度不错；就月考成绩来看，准确率应该是不差的。还是希望孩子能认真对待书面作业和听写，每天抽出10~20分钟背单词。]'), ('4d169003-0a