思路，形成自己的做题网络体系]'), ('7dffb4c4-d660-43a5-b2dd-992f114c4798', '[优, 优, 一般, 良, 良, 良]', '[, , , 课后多加强复习老师上课讲过的内容, , ]'), ('ac23f69e-1c3e-4d13-a916-d6eb051fee20', '[122, 323213213232132, , 3213, 3123, ]', '[, , 213321, , 3213, 213]'), ('d4b55546-74f3-4efe-9f5e-71b7c0e74b78', '[总体比较认真，做题也比较积极，有时候比较懒散。, 对于我强调的考试的一些考点，还有一些小词的区别和用法，宇航能够记住并在做题中体现。也提升了宇航做题的兴趣。, 可能因为学习任务比较中的原因，宇航很少或者说几乎不太会预习，但他喜欢做题，会提前把我给的资料上的题型做一下，这还是令我很感到欣慰的。, 每次上课，我都会带着他去复习一下上节课讲过的语法，单词。宇航对于提问也积极回答，但总感觉掌握不足。, 做题技巧什么的在根据个人学习经历，等的讲解，还有我掌握的，以及机构所提供的资料。发现他答题技巧方面有很多掌握比较不错，也学会了应用。, 做题方面，宇航本身就很喜欢做题，尤其是刚学到的知识的马上应用他很感兴趣，做题速度及准确提高了不少，他学会抓关键词了。]', '[叔叔阿姨，通过将近一个月的与宇航的接触，我感觉宇航是一个很听话，也很爱问问题的孩子，他其实真的很好学，我给他讲做题技巧，什么是重点，怎么抓关键词等他掌握的很不错，我也看出来他也很想学好英语。他做题的速度与正确率也提高了不少。, 但是，光有技巧是不行的，基础要扎实才行。经过我一个月的讲授我发现，我上节课给宇航讲过的语法，还有单词等，很多他都不记得了。除此之外，我发现，很多本来是他们课堂上老师讲过的语法，单词，短语。他都不记得了。你们也都知道，学英语最重要的就是要有语法和单词的积累，如果不知道，那肯定是学不好的。, 如果语法和单词掌握不够，那做题比如阅读是很吃亏的。而宇航又恰恰是一个很好学的人，他每次都会主动问我一些关于中考，英语以及大学的使，我也能够深切的体会到他确实也很想学好。, 但是因为他们早读什么的不背单词，让他周末自己背可能效果也不好，而且我们上课我也感觉到时间太短了，我有很多内容讲不完也不能带着他讲很多的单词语法，而且讲的时间很短他可能也记不住。, 所以接下来我又这样的建议，希望阿姨你能延长我上课的时间，我建议是三个小时。因为我考虑到这个学期最多还有七八个星期。内容还有很多内容。但我主要是考虑到用开头半个小时和最后半个小时背单词，记语法。因为这一块内容真的很重要。, 我也考虑到我每次去在路上就花了一个半小时，但回来只要二十分钟。这个时间段浪费的时间真的太多了。如果可以，我希望时间改成上午或下午。但如果不方便的话，晚上六点半到九点半我觉得也合适。最后，我个人讲课可能少了一些严肃，我会从下次起积极改正，也希望阿姨你们同我一起好好监督宇航学习。]'), ('3245dc41-f322-4cb7-944f-5fa1cc7bf6ec', '[在分数上面进步不明显，但在知识面上有一定掌握，从盲选盲做到有根据的选，有根据的做。学习态度较好，愿意自己去尝试训练。, 对所授知识只能浅薄的运用，课下没有花时间去琢磨，去思考。, 无，但基本能完成布置任务，该生基础较差，欠下知识点过多，正慢慢弥补。, 对上课所讲授内容越有60%能够掌握。, 传授合理安排数学这门考试的考试时间，以及应题策略。, 运算技巧方面有一定提高，得分目前主要集中在选择题上。]', '[希望在该同学接下来学习的过程中，能够变被动为主动，勤加练习，不要全依赖老师上课的时间，在课下也应当主动做题。, 课下应当主动去想去琢磨一些问题，不要上完课就什么都不管，什么都不做了。, 能更主动，更积极的去学习。, 希望花更多的时间去复习和巩固课上所授内容。, 多加训练。多加熟悉。, 希望通过课程的讲授，能够完成预期的目标，在大题部分的分数能够提高20-30分。]'), ('c45bbd26-71b4-4e24-a3c2-a4e5a0a59014', '[认真程度一直在进步, 比家教之前掌握的细节要多, 学习热情很高，会按时完成布置的作业, 家教之后文莹学会课后复习当堂讲的内容，并在下一次课与老师交流, 这方面还有待完善，特别是图形板块需要做辅助线的题, 准确率相较之前有显著提高，速度一直保持在中等水平]', '[希望学生可以放平心态，一步一步走, 要多注意记忆，注意细节, 主动预习的能力还不是很强（这也可能与作业多有关）, 希望学生复习巩固的过程中也要注意多做一些同类型的题, 多做相关类型的习题，培养自己