，正确率不能做到完美]', '[这一点做的很好, 接下来会注重这方面问题, 接下来继续保持, 会认真讲解作业错题, 会督促其注意技巧的积累, 准确率取决于知识的掌握情况，会教其加强记忆]'), ('4d57a4aa-89d5-431e-b7b9-057db1941b96', '[学生状态不错，听课专注, 七年级上册第一单元掌握的不错，第二单元有所欠缺，需巩固, , , , 做题速度快，但读题不细心]', '[, 巩固第二单元知识点，帮助他构建知识网络, , , , 增加做题，训练对题目中易错处的重视以及敏感度]'), ('adfdad63-4dde-4765-955c-9ff1a9b0bb1c', '[听讲认真，专注度高。, 基础知识掌握扎实，推论或公式的运用技巧较欠缺。, 下次上课的题目会提前看并尝试解答。, 会主动复习做过的题目。, 总体不错，考试时心态调整方面可以更好。, 做题速度不是很快，准确率较高。]', '[可以更多的积极互动以营造较轻松氛围，多讲一些自己的想法。, 在理解基本概念的前提下尝试自己推导公式或者推论来加深理解。, 考虑到空闲时间有限，解答时也可以不必计较于具体计算过程，只需对解题思路有清晰的把握，列出主要的计算式即可。, 可以对同一类的题目进行思路解法的归纳总结。, 学会取舍，尽自己最大力量解答所有的题目，但不是一定能全部做出，所以还要注意考试时心态的调整，比如可以有积极的自我心理暗示。, 在保证正确的前提下提高做题速度，多进行草稿演算有助于清晰思路，另外可以划出题目中的关键信息来帮助做题。]'), ('823026df-1f72-476f-bb79-ab29e51aa85d', '[学习态度良好，专注力不够，不够有耐心, 基础掌握得不牢固, 不够主动, 不够主动, 不够牢固, 不够准确，粗心]', '[要认识到学习的重要性，提高学习热情, 加强基础学习, 加强主动学习, 加强主动学习, 加强技巧的掌握, 加强习题训练]'), ('85901781-3018-4851-a6ae-004a76eaf0e5', '[上课专注度很高，基本能全神贯注，认真思考每个问题，看每道题。但思考局限于惯性思考，深度思考稍有欠缺。, 基础知识体系没有大的问题, 主动预习情况较好, 复习巩固不是很及时，有部分知识点有点淡忘, 考试技巧基本可以，但不成体系，不太全面, 做题速度非常快，准确度有待提高]', '[对于基础不错的雷汶韬来说，建议就是在引导下多做深度思考，可能会达到学会一道题掌握一类题的效果。触类旁通，举一反三对于提升汶韬很重要。, 该做好的是查漏补缺，熟悉各个知识点，能更好地应用它们, 对知识的渴求度比较高，衷心希望接受新的知识，这点希望能继续保持, 主动复习巩固实在全面了解自己的前提下进行的，今后将教习发现自己漏洞的一般方法，告诫及时进行不熟悉知识点的温习。, 今后这点将是主要教学点，将会有体系的考试技巧教于汶韬，包括计算技巧、解答技巧、证明技巧、猜答案技巧、解方程技巧等。, 在保证准确率的前提下再进行速度训练才会有大的进步。]'), ('adc9a87a-a3f8-4ddc-87f8-5be81bcbe18e', '[专注度有所提高，特别是之前和孩子沟通上课时沉下心来不玩手机后，基本上课时不会再分心玩手机了, 可能中间一段时间的缺课，对浮力方面知识掌握不太好, 月初表现较好，后面表现较差, 对物理学过的知识复习的较少，主要是在授课时候帮助复习，自主复习的可能较少, 有一定进步, 尚需提高]', '[保持专注，同时还能够在上课时开动脑筋，多多思考（会侧重更多地与孩子之间的互动）, 后面还要侧重于浮力知识的教授，不仅仅知道大体框架，还要对相关计算有一定的敏感度；, 后面还要多方面提醒孩子预习，适当给与一定的鼓励和奖励。此外，兴趣也是很重要的一方面，后面也会更多给孩子展现物理有趣的东西，鼓励孩子自主学习；, 转变孩子学习物理的习惯，积极和他沟通：了解老师布置的题目应该独立完成，结合平时习题来更便捷地复习；, 对于考试题目，不管怎样，保持耐心把所有题目的方法、考察点、结题技巧、与书本的联系等方面和孩子较全面地探讨, 还是需要经常提醒下孩子保持细心，对待物理的问题很多时候不能太过大意]'), ('ab0a0609-a4b8-4c83-ba46-762f867128a0', '[, zxvdzs, , , , ]', '[, , , sdvz, , ]'), ('3cdee501-0868-4b11-898d-a8febd4f09ab', '[认真, 较前理解能力提高, 初三以复习为主吧, 有待加强, 较前提高, 较前提高]', '[, , , , , ]'), ('3b4b64c6-9463-4b8c-a770-689