收手机后学习效率明显提高。, 这三次课程的主要内容是八下:一次函数和正比例函数,八上：一元一次不等式的求解和一元二次方程组，另监督并考察学生生物地理背诵内容，对于基础概念和题目，学生基本掌握，但对于题目的变形和复杂化，需要加强练习。, 关于第三次课程监督并考察学生生物地理背诵内容时，学生能准确背出要求背诵内容，说明学生对于记忆性知识点只要努力就可以完成，故后阶段我准备整理初一至今所学的重要公式进行强制背诵。, 主动复习巩固方面学生做的不是很到，平时做题不多，故需要培养学生的做题兴趣。, 简单题目技巧基本掌握，能快速求得结果，但对于多考点问题，还需综合知的运用，这需要大量做题才能做到孰能生巧。, 学生对于正比例函数和一次函数有一点基础，但做题时仍有粗心的毛病，有时做题会把 题目条件写错导致结果错误。]', '[预计下阶段继续保持不让学生碰手机,尽量缩短学生上课期间去卫生间的时间.端正学习态度。, 预计下阶段教授一元二次方程和一元二次函数内容，紧跟学校教学内容，使学生能够掌握初中的重点内容——函数，在学习完基本内容后，大量做题，以达到掌握的效果。, 在记完公式后要求默写，并整理出公式对应的题目加以理解，明白每个公式的具体应用。, 学生的惰性较大，平时做题不多，所以准备下阶段练习完公式所对应的题目后会准备相应习题强制进行巩固复习。, 着重强调重要考点，大量做题找感觉, 特别欣慰的一次课程体验是：在学生经历集中的状态下讲完知识点后让学生做题，学生对于中下等难度的题目能直接选对答案，说明对于教授的内容已完全掌握并能达到熟练应用的程度，所以希望能和学生共同进步，多一点这样的场景。]'), ('ac70b329-5dda-4ef2-a4fe-2fc3efc08f52', '[有所进步，仍需努力, 有所进步，仍需努力, 有所进步，仍需努力, 有所进步，仍需努力, 有所进步，仍需努力, 有所进步，仍需努力]', '[希望学生好好学习, 希望学生好好学习, 希望学生好好学习, 希望学生好好学习, 希望学生好好学习, 希望学生好好学习]'), ('732a30b5-5cce-4245-9e2f-2fff873d6eb8', '[好一点, 变化较小, 做的不太好, 好一点, 仍有进步空间, 仍有进步空间]', '[接下来会有些限时训练, 接下来我会更加专注物理一科, 学生学校任务较重 对课外作业的完成度低, 接下来每课的内容堂一个知识点会分三步进行巩固 下次上课时会巩固一下上一, 学生现在高一主要任务是对知识点的掌握，掌握知识点了就能比较好地掌握考试, 学生有时候比较粗心 会 容易看错题 这一部分希望限时训练能帮助到学生]'), ('82921c6c-9b65-4c04-8a54-d6acf62dd60b', '[一直表现很好，很认真听课，跟着老师的思路走。, 对于数学的函数解题方法有了很大的提升，熟练了做题过程，还有几何证明方面也了解了基本思路，对于物理电学方面能够根据公式解题, 有待加强。, 按时完成作业，有很好的态度。, 进步较大。, 做题速度很好，但准确率偏低，有待加强。]', '[, 数学方面：对学生针对一些中考常见题型进行练习，重点放在函数·几何方面，物理：提问必背公式，对电学加强练习。, , , 会教授给他一些应试技巧，比如考试时不能死坑难题，不会的就先放放。, ]'), ('30118fb8-d767-4e5d-aae0-0dd538a0f002', '[专注度保持良好, 基础知识掌握全面，单词积累较为薄弱, 尚未养成, 有考前复习的习惯, 考试基本技巧有所掌握，但语文和英语部分题型掌握有待提高, 做题速度较高，语文准确度较低]', '[继续保持, 增加语文课外知识积累，单词及语法知识积累, 引导养成良好的预习习惯, 将复习习惯带入学员的日常学习当中, 加强对语文文言文，古诗词技巧训练，英语五选四训练, 帮助学员多积累多练题，提高语文准确率]'), ('02251cdf-ea7d-464a-9d6a-79b6dd18ae33', '[有的时候上课发困，注意力会受到影响。, 讲过的题基本上都可以掌握。, 现在正在一轮复习，复习进度跟上学校老师的步伐，能不落下就很好。, 每次上课前会复习巩固上节课讲过的知识点和错题，文理基本上可以掌握。, 考试重点平常上课的时候会经常讲到，文理也有认真地在听，掌握的很好。, 做题速度相对较慢是因为刚开始复习这一部分内容，但正确率很高。]', '[中午休息好，下午上课的效果会更好。, 平常学习中及时的翻笔记以及背诵记忆一些物理化学中必要的知识点，这很重要。, 一轮复习关键在于对知识点的掌握，这一阶段要紧跟学校老师的进度，不要落下。, 上课前把上个礼拜讲过的最好看一遍，复习一下，下一次上课会提问上节课讲过的错