范，如:\n  6写出来像2\n, 主动预习情况良好, 主动复习和巩固做得不太好:\n1.之前知识点的遗忘比较严重\n2.纠错本的复习也做得不太到位, 考试技巧掌握不太好, 做题速度还是很快的，但准确率不是太高]', '[不论上一次是什么原因，但希望雷汶韬能把以前的状态找回来，积极配合，共同进步。因为接下来的工作量会有点大，可能讲授的内容每次都会增多。临近期末考试，复习前面的知识也即将开始，精神状态好效率才更高。, 初一相关知识和考点已经复习，以后会择机进行复习。细节问题和习惯问题不可急躁，要慢慢改，会以后经常督促和提醒。书写问题也会进行时常纠正和提醒，因为这个确实也不敢疏忽。, 希望继续保持，时间允许的情况下会引导预习和超前学习, 如果感到哪块遗忘严重，我会正片复习那块知识面，这个方法也会教给他，希望他能学以致用。 纠错本的重要性不用多说，我会提醒他考前复习，时常翻阅，纠错的目的是不再犯错，所以这个也会重视起来。, 在上一次期中考试中，竟然有一道填空题没有做，不管时间允不允许，会不会做。以后也会常常提醒他，选择填空题绝对不能空着，因为随便填一个可能会对啊，不填一定不会对。, 会常常提醒他，在保证准确的前提下，再谈速度。因为做的快，但做错了也是无用的，还不如做得慢，准确率稍微高点好。还有他喜欢口算而不是笔算，这样会降低准确率，这个也会经常提醒。几何问题数形结合很重要，不能嫌麻烦而凭空想象，数形结合可以提高准确率和速度。这点在以后的讲述中会经常提醒。]'), ('5e7570b2-2908-49ff-9ba2-3e3c0747364e', '[听课还是和以前一样认真，注意力集中, 基本知识较以前有所提高，但还是不太熟悉，运用不熟练, 预习的习惯还未养成，原因是老师没讲自己提前看的话看不懂并且老师讲了也不一定能完全理解。, 这方面孩子做的不是太好，对以前学的知识遗忘程度稍有严重。, 基本技巧掌握到位，略难的解题思路掌握不是太好。, 审题不是太严密，容易忽略题目条件，计算能力薄弱。]', '[会更多的让孩子主动去算，去画图去理解也可以同时提高孩子的计算能力, 在解题过程中穿插复习相对应的知识点，从而让其加深理解学会灵活运用。, 温故而知新，我会通过前面知识的复习加深对后面即将要学的知识的理解并且让孩子熟悉相关术语与概念，从而不怕预习，让孩子会找问题。, 新知识都是建立在旧知识的基础之上的，所以在后面的学习过程中肯定会遇到前面的知识，从而达到复习效果。, 练习孩子看清题目本质的能力，知道出题者的意图，达到知己知彼，遇题解题的效果。, 勾画题目条件，加强运算能力，运算速度以及运算技巧。]'), ('4493cd60-daa1-4f9f-8ad6-2a9af21322d0', '[注意力集中, 基础词汇不牢, 差, 中, 良, 速度较慢]', '[暂无, 依旧需要加强记忆，养成习惯, 最好能上课前熟悉词汇, 几乎不复习，需要形成习惯, 暂无, 阅读能力可以，但是词汇量还是要提高]'), ('871402b7-94fd-4788-9f3d-56aa208ac0bf', '[听课都较好 经安有时候有点开小猜, 对新知识掌握还行\n但是对于以前讲过的东西有一定遗忘\n对以前错过的题目掌握还是不够, , , 对难题突破还是不够\n有点不细心  对题目缺乏思考, ]', '[坚持错题本\n学会挤时间\n抓紧平时课堂\n多复习以前的知识要懂得温故而知新\n加强题目的训练 养成善于思考勤于思考细心谨慎的做题习惯  , , , , , ]'), ('7a5d50f2-4f57-4571-9b52-512ec25fccc3', '[, , , , , ]', '[, , , , , ]'), ('edbfa318-e71f-46cc-8aa5-5b0199b81255', '[上课思维较为奔逸，偶尔讨论与课程无关的话题, 有进步, 无, 准备力度较前加强, 有进步, 仍需提高]', '[老师适当引导监督, 加强练习，胆大心细, 无, 举一反三，错题练习, 老师多讲解经典例题, 加强错题练习]'), ('07100216-6bae-47bc-a2bb-d00a055f4b93', '[良好，应该是感觉到考试能力有所提高，听课更加认真, 对各个知识点掌握得更加得心应手, , 复习的还不算太好，会有同一问题反复出错的问题, 稳步提升, 稳步提升]', '[希望能更加专注，记住所教授的知识并熟练应用, 知识点掌握的不错，可是还需多加练习，最好能做到一眼就看出要考哪些内容以及出题人的意图，以便解题更快更准。, , 希望学生能自觉多加复习，牢固掌握解题技巧以及出题形势，熟能生巧。, 听都听懂了，但熟练运用还不够，希望勤加练习, 做题速度越来快。准确度方面也提升较为明显