INSERT INTO suggestions VALUES ('e3b49e5b-63eb-4f21-8e45-5e240d881431', '[听课认真, 基础知识掌握情况有进步, 未安排预习任务, 学习积极性提高，有进行有效的复习, 技巧掌握不错, 速度和准确率有所提升，但是难题得分率较低]', '[继续保持上课专注, 需要反复巩固练习基础知识, 在学有余力的情况下学会简单预习功课, 保持学习热情，课后积极巩固知识, 保持平和心态，运用考试技巧, 保证做题速度的同时保证正确率，掌握好基本题型之后在进行难度的加深]'), ('cb5cda94-5e7f-4ba3-a3cf-4255401b00be', '[前半月表现可以，后半月有所下降, 70%大概每次上完课后, 本月无明显表现, 只会完成我所布置的作业, 英语方面有所提高，其他的有所下降, 速度快，但是准确率偏低]', '[自己要懂得，才能有所提升, 注重细节，在英语上还能有所提高, 强调了无数遍，靠家长反复提醒, 初三的后半段基本上全是复习，所以必须好好掌握这项技能, 希望以后多多钻研理科题目, 放慢速度，提高准确率，时间是充足的]'), ('503ef221-1292-4f2c-98c5-1d7d5de9c710', '[专注, 中等, 中等, 较好, 中等, 一般]', '[强化知识点, 强化知识点, 强化知识点, 加强知识点的复习, 适当培养一下做题技巧, 做题应细致]'), ('6f7ff226-ebb0-4531-8b5d-5dd4d2b23b71', '[专注, 较好, 较好, 较好, 较好, 中等]', '[强化做题技巧, 对于知识点的掌握应再熟练一点, 继续努力, 继续努力, 认真读题，时刻想着知识点, 做题应细致]'), ('27b3a1e9-6e74-4af3-8204-3a4ab9f84bd1', '[听课更为认真，听讲时更加专注，做题也更加细心，态度较上阶段有很大提高。, 代数方面知识掌握良好，几何方面知识有漏洞，不擅长图形结合的题目。, 孩子一般不会主动预习和超前学习, 最近期末考试，会通过老师的习题来最一些知识巩固，复习曾经的知识。, 做题全靠自己的临时发挥，对不同的题型没有固定的技巧方法。, 做题速度偏慢，准确率仍不高]', '[学生还应加强自我主动性，多主动提问题，多主动做题。, 学生应深入了解几何方面知识点，多加练习几何方面的习题，争取在考试中，做到做题快、准的标准。, 不建议超前学习，可适当预习新学科目，不过要确保当前阶段学习的, 孩子不爱主动复习，建议应多做一些综合试卷，全面复习知识点。, 多做习题，通过习题的锻炼，掌握考试技巧，更多的练习让其提高做题准确率。, 学生不经常动笔，爱口算，导致准确率不高，而且口算没有一个好的思路体系，做题速度也没有提高，建议学生勤动笔]'), ('8b526bea-90c8-4789-9ba7-acbff689d41c', '[上课较专注, 基础知识掌握不够扎实, 能主动预习些知识, 能主动复习巩固些知识, 考试技巧掌握不够, 做题速度不够快]', '[上课需更专注, 加强基础知识掌握程度, 加强主动预习能力, 继续加强主动复习巩固能力, 加强学习考试技巧, 需加强做题速度和准确率]'), ('30476f8d-e7aa-4686-a3e3-ffae3e9cd75f', '[一般, 较差, 无, 较差, 一般, 一般]', '[, 课后整理笔记并复习, , 课后整理笔记并复习, , 不要追求速度，落笔前先思考]'), ('7ebebcc7-686e-4a71-b9d5-0e150a578fde', '[进步, 进步, 进步, 进步, 进步, 进步]', '[祝以后的学习更上一层楼, 加油哦, 以后学习的主动性希望可以更好, 加油呢, 已经很不错了, 提高准确率和速度要更加加油哦]'), ('3d44c9e2-749e-4e35-8c65-63b2781a6a90', '[听课专注度有待提高，注意力集中时间不长, 基础知识总体过关, 需要老师提醒方可预习, 需要老师以作业的形式布置下去, 没有明显问题, 准确率较高，但速度有待提高]', '[需要家长配合，共同调整孩子的状态, 查漏补缺, 提高学习自觉性, 通过长期的作业布置逐渐培养孩子复习的习惯, 下一阶段继续观察, 限时训练，提高速度]'), ('0df2b8e0-0bfd-4e25-ba91-59d090223607', '[上课认真, 知识掌握良好, 不做要求, 还需巩固, 掌握良好, 速度适中，准确率有待提升]', '[不要求, 不要求, 不要求, 要牢记知识, 不要求, 看题要认真，不要急]'), ('23fbbb14-cfd5-48e0-