掌握的很差，基础一般，英语口语很好，语文有一定基础。, 没有预习习惯, 没有复习习惯, 技巧有一些, 做题速度很慢]', '[上课需要专注一点，孩子有些叛逆，懂很多道理，却很难去努力，需要家长给一些引导，得让他找到人生的目标。不要单纯是成绩变好之类的，更多是我要做什么需要好成绩。他有和我说过喜欢画画，想做一个动画策划师，我也告诉他，这些都是以成绩为基础的。希望接下来能给他一些帮助, 英语加强词汇的积累，希望能让他在家也背单词，语文需要加强对古诗词的背诵理解, 学习习惯有点差，接下来引导他主动学习, 也不能急，他现在其实还有机会改正这些坏习惯，得慢慢来, 不能依赖答题技巧，总是靠蒙。知识点掌握最重要, 最主要是学习时候难以静下心，学习态度需要改善。接下来需要尽量往这方面引导]'), ('5a67922b-9c5c-42e4-b507-055e60012495', '[听课专注程序较上一周有很大进步, 掌握的不好, , 这方面做的很不好，经常就是我上课讲的一听就会，但是到下次来就不会做了, 对数学这个变通性不太好, 速度很快，准确率不高]', '[希望上课可以更专注一点, 希望回去可以自己整理我给讲课的内荣, , 可以用专门一个本子对我讲的技巧自己整理，多抽时间看一下, 多做题练习, 要细心，做题一定要细心，尤其是数学题]'), ('1de20c14-aecd-45ed-8214-c52074bd52ae', '[, , , , , ]', '[, , , , , ]'), ('f14b5aa6-e3d9-4b66-82fa-6f69c2316984', '[, , , , , ]', '[, , , , , ]'), ('40c58fc7-7ec9-4d30-b0c5-563a9d43e846', '[听课比较专注, 知识掌握很熟练, 没有主动预习, 课后投入时间不够多, 技巧掌握较好, 学生基础较好，对于一般难度的题目速度及准确率均较高]', '[建议提高注意力集中度，高效利用家教的两个小时，保持心态平和, 语法等基本无问题，着重提高单词量, 无, 英语需要多记多背，建议课后多投入时间，熟练掌握单词以及词组, 多练习写作部分，有意识的去使用所学到的高级词汇，词组以及长难句, 可做适当拔高]'), ('d897a4a6-f050-4b5e-9853-f4c9dc3c7212', '[有进步, 物理方面依旧欠缺，数学方面有明显进步, 依旧欠缺, 有进步，但还很不足, 有进步，但依然要多加练习，把技巧转化为常识, 速度可以，但准确率差强人意]', '[高中依然要坚持听好每一门课，上课注重听，不要单纯地做笔记，要有意识, 物理要注重基础，数学还要坚持，要多巩固练习，多练习, 要培养主动学习的精神，多去练习自己不熟悉的板块, 每次听完课，要注意复习，当天的复习记忆最深刻, 每一次比较经典的技巧题，要多加练习, 前提是要保证准确率，做一步看一步，检查一步]'), ('cc4b0378-69d7-4d42-a1fd-006aca690d50', '[一直很专注，有明显进步, 基础知识较上一阶段更加扎实, 主动学习的劲头很足, 对于一些比较难的题目复习劲头仍旧不足, 相比上一阶段技巧运用有进步, 速度和准确率都有进步]', '[听课要注重问题的关键点，关键听自己不会的地方，高中听课更要这样, 要多反复，多巩固，基础知识的问题不要再出错, 要学会调控时间，在不熟悉的科目上要多倾斜时间, 当天要把所学的知识点复习巩固，特别是全新不熟悉的知识更要注重复习，当天的记忆最扎实, 对于一些经典题目中出现的技巧，要反复多看，将技巧转为常识, 基础性的题目要多加检查，不要一味地追求速度]'), ('eddc9b90-5355-4862-984b-ef14c9a4abe5', '[听课认真，几乎不走神, 梳理后能准确把握, 预习不足, 复习不错, 基本了解解题思路, 速度适中，较为准确]', '[继续保持, 进一步加深, 争取增加预习时间安排, 时常复习, 多做题积累, 继续保持]'), ('fbf73235-b5c3-434b-9b64-88950def5dc0', '[比之前有进步，听课比较专注, 有很多细微知识掌握的不够到位，大概的知识点还是能够记得的。, 没有超前学习的习惯。, 不太喜欢主动复习，这样十分不好。, 考试技巧明显不足。, 速度不是很快，准确率也不是很高。]', '[希望能做题的时候有点耐心, 希望不要忘记之前上过的知识。, 还是希望能够稍微预习一点点。, 要经常复习以前的知识点，这样才能掌握的牢固。, 多做题，多听老师讲的简便的方法。, 希望能练习练习计算，计算不够好]'), ('51440678-2015-43f5-8303-d5a6c22fb18d', '[心情好的时候听课比较好，心情不好的时候会不在状态，上课很容易扯到别的去了，需要把他拉回来。, 新的知识点掌握的比较好，但是学过的知识点忘了很多，特别是那些细微的知识点都忘记了。, 以前还能往前自学一点，最近比较散漫，就很少自学了。, 没有去复习巩固的习惯，所以学过的知识才会忘得很多。, 考试有一定的技巧，但掌握的好不够，后面大题舍弃的太多了。, 速度勉强还行，但是准确率不高，太粗心，从审题开始就很粗心。]', '[希望他上课的时候不要总是聊别的东西，多把注意力放在听课上。, 多复习，经常看看以前学过的东西。, 尽量能够超前学习一丢丢，这样便于新知识的记忆。, 要经常复习，温故而知新，把那些细微的知识点牢牢记住。, 多练习，多总结，多学习别人简便的答题技巧。, 多练习，多计算，可以适当做慢点，先要有准确率才能有速度。]'), ('9249f80a-16ad-497a-9875-e3b43eb6de2d', '[临近考试，学生更加认真了, 知识掌握得更快，并会主动提问, 主动性很强，很听话, 复习仍需督促, 选择题和作文技巧掌握的还不错, 速度提高了，选择题正确率有所提高]', '[希望外界条件对他的影响不要太大，不要压力太大, 学的很快，可以接受更多知识, 主动性逐渐提高, 复习能力也有所加强, 部分选择题仍需要读懂文章才能掌握, 速度有所提高，坚持限时训练]'), ('38c46631-956d-4b90-ac41-d9158a9b45cc', '[上课能紧跟我的思路，专注度有进步, 知识掌握较好，运算较以前进步很大, 紧跟进度，预习较好, 作业完成较好，复习较及时, 应试技巧有所进步，掌握的应试方法比以前增多, 速度和运算准确率进步较大]', '[在规定的学习时间里不去想其他事, 把书本上基础知识掌握的前提下能做一些课外习题强化自己对知识的掌握, 课前预习把自己不懂的地方记下来，上课的时候提出来, 课后一定要复习，把当天所学到的东西在大脑中过一遍，把自己做错的题亲自动手做一遍，切忌眼高手低, 考试是综合性的，不只局限于课本，平时练习的时候多想，增加思维的灵活性, 首先要保证准确率，然后可以提高对自己的要求，提高做题速度]'), ('b900861f-fb5d-4bd5-8789-f5b6b036a88b', '[学习态度端正，专注认真, 知识点掌握情况不错  能主动找自己薄弱点要求加强, , 每次上课之前会对上节课做过的题目和复习的知识点进行复习巩固, 针对不同题型能综合运用不同的解题方法, 准确率较之前有明显提高]', '[, , , , , ]'), ('54f90b0f-f98b-41e5-8888-dab7a9296b5f', '[听课一直都很认真, 物理和化学基础知识都掌握的比较差，物理相对较好, 没有主动预习, 没有主动复习, 能分辨出题目要考察的内容了, 不高]', '[上课认真听的同时要思考，要提出问题, 高中要尽量跟着老师的上课进程扎实基础知识, 要尽量预习，能达到更好的学习效果, 一定要复习巩固重点，硬性知识点要记忆, 对于不会做的选择题运用排除法等，不会做的大题尽量写出可能用到的公式定理, 有所提升]'), ('6f85cc59-1624-4983-a039-1877ba3cc1a2', '[一如既往的专注, 有些知识点有点模糊，新学的知识还不太能运用, 一般都没有主动预习, 璇子本身对知识吸收的比较快，巩固的较好, 不会做的能运用很巧妙的方法得出答案，很机智, 做题速度挺快，但是计算粗心导致准确率不高]', '[听老师讲评时学到的新知识点或是解法要学会运用到其他地方去, 要即刻巩固旧知识点，即刻消化新知识点并加强应用, 很多学校老师上课没讲到的知识点我讲到了。也要重视，其实真实情况是很常考常用的，这也算是超前学习, 继续保持, 继续保持, 好习惯是从平常作业就养成的，平常也要认真对待]'), ('2919b7c7-4d11-4130-939f-79f6912e23d7', '[有进步, 有进步, 和之前一样, 有一点进步, 无明显变化, 有一点点进步]', '[要更加认真 课堂多做笔记 解题思路要多在脑海里过几遍, 在掌握一个新知识时 要一题多解和多题一解 多总结 可以做错题本, 在预习时把不会的地方标记 听课的时候或者下课问老师把疑问解决, 因为基础不是很好所以以前的知识把握不是很好 一定要课后找题多做多总结, 现在主要是巩固知识和学习方法 考试技巧比较少, 这个一定要重视 看题一定要认真准确草稿尽量让自己也看得懂]'), ('c27fe87d-44d7-4327-8cb5-4892502efd68', '[很认真, 良好, 良好, 良好, 良好, 良好]', '[继续维持，