是如此]', '[希望继续保持, 养成归纳知识体系的习惯, 继续保持, 希望能把自己的知识缺漏记下来，不要错了不少题才意识到, 继续保持, 多刷题]'), ('04a7b192-8493-4a12-b6c9-d14884405637', '[无退步情况；上课专注，与老师配合紧密。, 理解力水平优秀，能紧跟老师节奏进行理解。, 暂无该方面需要，扎实复习所学内容更为重要。, 从与孩子沟通情况来看，孩子在英语学习方面的欠缺集中体现在分配给英语科目的学习时间不足。, 学生考试卷面的呈现表明学生已经达到70%的中等得分水平，对考试技巧有一定掌握。, 当前未测试做题速度，但在首次课程中学生反映出的短文阅读速度尚可观，达到中上水平。]', '[保持认真的上课态度，且在每次课前安排好休息，以保证优良的上课状态。, 保持当前听课状态，勤思考、多互动。, 保证对每次课程内容的自我回顾与巩固。, 学生需要合理规划各科学习复习时间，就当前基础来看，学生每天还需在上课之余依据当天上课内容，准备40-80分钟不等的自主复习与巩固。, 在后期辅导留下的课程训练作业中，进行一定量的试题巩固练习，兼顾相关得分技巧的训练，务必按质按量且在规定时间内完成所留训练作业。, 在课堂及课后作业中，将安排相关答题效率训练。]'), ('e9a9e441-ad56-4922-a29f-65875d23600d', '[, , , , , ]', '[听课时多动笔，题目听懂的话直接做出来, 平常听懂课本知识外，还需多做题目从多角度熟悉所学知识, 能够课前完成预习作业，但建议自己多从自己薄弱章节入手，多做些布置要求之外的题目，找到自己不会的提出疑问, 考前翻翻错题，而到了初三一定要准备数理化错题本, 基础题保证做对，拿到该得到的分数，难题按步骤做，会多少写多少, 公式记牢，多做练习，数据代入要准确]'), ('6004e497-8c03-469f-8de2-98ee9329c15a', '[挺不错的, 基础知识更加牢固了一点, 有待加强哦~, 主观能动性提高, 有待加强哦~, 做题速度仍然需要提高]', '[, , , , , ]'), ('0b618ec7-bd53-4176-ac1d-50c4a3e097c7', '[已在授课反馈上详细说明。, , , , , ]', '[, , , , , ]'), ('c51daa45-aa17-48f8-8cd5-66a54437c521', '[采取了新的方法，听课情况有改善, 有进步, 无, 已经到最后阶段，有自己的复习计划, 良好, 对于现在来说，成绩才是评判的最好标准。]', '[学生已经考完试，不知道自己是否真的帮助到了学生，希望能渐渐找到学习的方法，养成良好的学习习惯，有更多自己的看法，态度鲜明。, , , , , ]'), ('8beac1a1-8366-4fd8-a567-f851edfcdee6', '[还是会开小差, 由于生地会考的缘故，落下了好几个章节的内容的学习, 没怎么预习, 没有能自主的复习，以及对未掌握知识的巩固, 还是欠缺, 没有提升的体现]', '[上课要聚精会神，不要想着别的事情, 要自己主动的学习自己欠缺的知识, 预习能力是要慢慢培养的, 要做到自主复习，把不懂得搞懂, 要学习更适合自己的技巧, 平时写作业便要按照考试一样，训练考试的速度]'), ('36c50603-0284-4c1c-8839-7d2ff8f98ea7', '[控制力还是不够, 知识没有系统化, 还是没有, 一般不会, 阅读题能力提升较慢, 词汇量有所提升]', '[更加提升刘严炜对英语学习的兴趣, 将英语学习知识系统化、理论化, 给他布置课前预习作业, 给他布置课后复习作业, 做几套卷子, 暑假对语法提升]'), ('0e4272e6-8118-4a20-8b7b-50dd1c5be314', '[有点畏难, 知识点没有系统化记忆，写作水平稳定度不高, 一般不会, 作业完成的很好，但是很少会主动复习已学的知识点, 答题技巧遗忘的比较快, ]', '[听课专注度一直很高, 加强写作的训练，特别是议论文, 会布置预习作业, 布置复习的作业, 定期回顾和做小测试, 做题的速度和准确度都有所提升]'), ('ad758cb2-d0c3-4f6b-aa3e-77d3bd28577b', '[还是容易走神, 生物知识点掌握越来越熟练, 未有明显进步, 作业巩固情况较好, 逐渐掌握过程中, 较上一阶段提高了]', '[专注力仍需提升, 对课本需要反复背, 预习需加强, 仍需不断巩固, 应保持做题的感觉, 加强训练]'), ('adcc2bc0-7ce0-4abf-8033-0ecdb6e8d19a', '[进步, 进步, 退步, 退步, 