INSERT INTO suggestions VALUES ('61a877da-d0fc-46ec-9f54-d3121188fd5b', '[听课比较专注，态度认真。, 基础知识掌握较好，重点还需要自己多进行总结, 预习习惯有所坚持, 有较好的复习方法, 技巧方面还有所欠缺, 答题速度和准确率均有小幅度退步]', '[继续保持, 备上单独笔记本进行重难点总结, 继续保持，划出不懂的部分，带问题学习, 多吃透对书本的基本概念, 建议进行专项练习，针对错误题型较多的知识点练题, 平时课堂小作业也需认真答题]'), ('0e617c08-c3c6-4849-a934-b53e15332f12', '[听课认真, 基础知识较薄弱, 良好, 良好, 较差, 良好]', '[建议多提问, 建于一多看课本和笔记, 建议提前看课本, 建议看试题, 建议多做题，进行联系, 多做选择题]'), ('6a55090c-f8ae-4523-84da-15f485ff2e70', '[宇航这一个月来专注度不是很好，很多时候比较困，可能是最近临近期末，压力较大。, 通过两个月对每个单元重点短语句型以及语法的讲解，宇航这方面的掌握情况好多了。, , 复习方面是每次和学生提过，上课也在不断把以前讲过的知识提问，还是有较好的效果的。, 考试技巧方面，每次听听力时教宇航提前看题。填空题抓住主干，完形填空前后对比，还有阅读时找关键词，划出人名地名，回到原文。以及写作文时先拟提纲，基本已经讲解的差不多了，作文及完形填空也有明显提高。, 速度有较大提高，准确率还有待改善]', '[我建议他期末了好好复习一下讲过的知识点。, 已经是期末了，希望宇航好好复习讲过的教材和两次知识点总结上的用红笔勾画过的知识点。, , 同上, 希望宇航好好掌握的基础上加快做题的速度，提高准确率，多做过关训练。, 每次掐住时间，固定的时间来做英语，即使总结和反思。]'), ('4aac46ec-976b-4fe6-a7c7-d8ea885b1871', '[, , , , , ]', '[, , , , , ]'), ('99b628af-1dde-4dc7-99fb-5468b1f9d2ed', '[听课挺认真的，都能认真听讲，, 能掌握部分常考知识点，另一部分则记不牢，或是记错。, 偶尔有，但是较少，.上课时也会给他提前讲解下一单元的文章，单词。\n, 也是较少,\n, 感觉掌握的一般般吧，也是丢分最重要地原因，, 做题速度挺快的，不算慢，但是准确率不高\n]', '[继续保持认真的听课态度。, 希望平时能多看课本，对于常考知识点，如单词，各种固定搭配，句型等牢记于心，, 希望平时有时间可以尽量预习课文，单词，, 希望平时可以倒回去复习重点知识\n, 希望做题时一定要认真再认真，仔细再仔细仔细地审题,尤其是阅读理解和完形填空，\n有时还要结合上下文选答案。\n, 对于不能确定答案的题目，希望可以稍微放\n慢一点点速度，仔细认真审题哦(O.O)。]'), ('20751efe-f7db-475f-bd87-0c8fac209b45', '[一直挺专注的, 匮乏，不能脱离笔记本掌握知识点, 能主动学习, 能主动复习, 还可以的, 这个很需要提高]', '[继续保持，最好能对我保持怀疑态度多问点问题, 多运用，试着关上笔记本写题, 功夫不负苦心人，多花点时间总是好的，熟能生巧, 回报与付出成正比, 投机取巧适可而止，灵活运用, 慢可以减少出错率但是太慢了就大大降低效率了]'), ('0598b8d5-214b-48ab-8391-afc991dae18e', '[很专注，学习态度认真, 英语词汇基础薄弱，语法掌握较为不错, , , 有一定的考试技巧, ]', '[将认真的态度坚持下去, 从基础做起，多积累，多巩固, , , , ]'), ('dd9c0d54-a97b-47cc-ad0b-98c454e86cd4', '[较好, 还需进一步识记, 一般, 较好, 较好, 较好]', '[继续保持, 需要进行多次识记, 需要具备一定的学习主动性, 继续保持, 继续保持, 继续保持]'), ('19e51f3d-4950-47ee-8aeb-f433c7b65df5', '[专注度明显提高, 掌握大部分知识, 会主动预习，超前学习, 会主动复习巩固, 能掌握大部分的考试技巧, 速度挺快的，准确率有提高]', '[会正式上课前提醒孩子集中注意力听课, 可以提前预习之后的课程, 预习的过程中把问题记录，及时反馈, 注意细节知识点的记忆, 在保证质量的前前提下提高速度, 多进行相关方面的练习，时间的把控准确]'), ('2304748e-e089-411e-9a3a-b438314ba7f0', '